function out = HodgkinHuxley
out{1} = @init;
out{2} = @fun_eval;
out{3} = @jacobian;
out{4} = @jacobianp;
out{5} = @hessians;
out{6} = @hessiansp;
out{7} = @der3;
out{8} = @der4;
out{9} = @der5;

% --------------------------------------------------------------------------
function dydt = fun_eval(t,kmrgd,CC,I,T,gNa,VNa,gK,VK,gl,Vl)
phi=3^((T-6.3)/10);
psialphaM=(25-kmrgd(1))/10;
psialphaN=(10-kmrgd(1))/10;
alphaM=psialphaM/(exp(psialphaM)-1);
alphaN=0.1*psialphaN/(exp(psialphaN)-1);
alphaH=0.07*exp(-kmrgd(1)/20);
betaM=4*exp(-kmrgd(1)/18);
betaN=0.125*exp(-kmrgd(1)/80);
betaH=1/(1+exp((30-kmrgd(1))/10));
GTOT=gNa*kmrgd(2)^3*kmrgd(4)*(kmrgd(1)-VNa)+gK*kmrgd(3)^4*(kmrgd(1)-VK)+gl*(kmrgd(1)-Vl);
dydt=[(I-GTOT)/CC;
phi*((1-kmrgd(2))*alphaM-kmrgd(2)*betaM);
phi*((1-kmrgd(3))*alphaN-kmrgd(3)*betaN);
phi*((1-kmrgd(4))*alphaH-kmrgd(4)*betaH);];

